import{_ as l,c as i,o as a,a4 as e}from"./chunks/framework.C3k1klfB.js";const c=JSON.parse('{"title":"Bugs","description":"","frontmatter":{},"headers":[],"relativePath":"zh/laplace/bugs.md","filePath":"zh/laplace/bugs.md","lastUpdated":1729139981000}'),u={name:"zh/laplace/bugs.md"},r=e('<h1 id="bugs" tabindex="-1">Bugs <a class="header-anchor" href="#bugs" aria-label="Permalink to &quot;Bugs&quot;">​</a></h1><h2 id="未实现" tabindex="-1">未实现 <a class="header-anchor" href="#未实现" aria-label="Permalink to &quot;未实现&quot;">​</a></h2><ul><li>职阶刻痕: <ul><li>令咒附加效果</li><li>杰基尔&amp;海德变身前后刻痕效果未正确变更(不准备实现了)</li></ul></li></ul><h2 id="将于v2-5-15修复" tabindex="-1">将于v2.5.15修复： <a class="header-anchor" href="#将于v2-5-15修复" aria-label="Permalink to &quot;将于v2.5.15修复：&quot;">​</a></h2><ul><li>指令纹章被视为被动的bug</li><li>移至队伍最末尾未消除无貌之月</li><li>支持对肃正贯通</li><li>支持糖果藤蔓</li><li>修正烟雾镜被动</li><li>【敌方相关】充能变动耐性</li></ul><h2 id="v2-5-14修复" tabindex="-1">v2.5.14修复： <a class="header-anchor" href="#v2-5-14修复" aria-label="Permalink to &quot;v2.5.14修复：&quot;">​</a></h2><ul><li>从者被动在添加负面效果时现在正确地无视弱化无效</li><li>修正因螺旋社调整数据结构导致的泳装艾蕾宝具伤害问题</li><li>支持新泳装BB <ul><li>支持其被动新添加的生效检测</li><li>支持新的宝具更换逻辑</li></ul></li></ul><h2 id="v2-5-13修复" tabindex="-1">v2.5.13修复： <a class="header-anchor" href="#v2-5-13修复" aria-label="Permalink to &quot;v2.5.13修复：&quot;">​</a></h2><ul><li>修正艾蕾好感度与御主技能<code>洗牌</code>的交互 <ul><li>将艾蕾放在队伍首位洗牌时可以增加好感度</li></ul></li><li>支持泳装XX宝具</li><li>【高难相关】修正攻击对肃正、无敌、闪避目标时该目标防御类buff的结算 <ul><li>如果该目标的对肃正、无敌、闪避生效，则正面效果的防御类buff不会生效、消耗次数，而负面效果的防御类buff正常生效</li><li>如果该目标仍要收到伤害则无变化</li></ul></li><li>【高难相关】支持 damageValue 和 damageValueSafe</li><li>【高难相关】修正敌方单位变化类技能</li><li>【高难相关】修正 ParamAddFieldIndividuality 的效果</li><li>【高难相关】支持带有 intervalTurn 的敌方 buff</li></ul><h2 id="v2-5-12修复" tabindex="-1">v2.5.12修复： <a class="header-anchor" href="#v2-5-12修复" aria-label="Permalink to &quot;v2.5.12修复：&quot;">​</a></h2><ul><li>修正库库尔坎等选择类技能无法使用的错误</li><li>修正泳装艾蕾与御主技能的交互</li></ul><h2 id="v2-5-11修复" tabindex="-1">v2.5.11修复： <a class="header-anchor" href="#v2-5-11修复" aria-label="Permalink to &quot;v2.5.11修复：&quot;">​</a></h2><ul><li>宝具伤害排行设置的助战无法正确加上buff</li><li>Overkill bug 未在宝具后重置</li><li>支持泳装艾蕾</li></ul><h2 id="v2-5-10修复" tabindex="-1">v2.5.10修复 <a class="header-anchor" href="#v2-5-10修复" aria-label="Permalink to &quot;v2.5.10修复&quot;">​</a></h2><ul><li>清姬 <ul><li>修复强化技能对灼烧敌人不生效的问题</li></ul></li><li>静希草十郎 <ul><li>修复致死伤害回避无视必中和无敌贯通的问题</li></ul></li><li>自定义技能 <ul><li>添加附加伤害项目</li></ul></li><li>通用 <ul><li>治疗效果现在不作用于HP归零的单位</li><li>【敌方行动相关】根据参数调整部分buff的生效回合数计算</li></ul></li></ul><h2 id="v2-5-9修复" tabindex="-1">v2.5.9修复 <a class="header-anchor" href="#v2-5-9修复" aria-label="Permalink to &quot;v2.5.9修复&quot;">​</a></h2><ul><li>苍崎青子 <ul><li>修复青子魔弹解除不正确判断解除是否成功的问题</li><li>新增对主人公补正buff的支持</li></ul></li><li>静希草十郎 <ul><li>新增对致死攻击伤害回避的支持</li><li>新增对NP比例增加的支持</li><li>新增对被伤害减免贯通的支持</li></ul></li><li>久远寺有珠 <ul><li>新增对覆盖隐藏属性的支持</li><li>新增对被即死时毅力的支持</li><li>新增对DoT伤害值增加/减少的支持</li><li>修复次数被动无法被扣到0次的问题</li></ul></li><li>通用 <ul><li>变身类技能/宝具现在会对除杰基尔之外的使用者重新加一遍被动以及调整atk和maxHp</li><li>修复由于青子AoE卡更新导致的部分纹章、攻击前后效果失效的问题 <ul><li>此次更新改了很多相关技能类型，与之前版本有差异是正常的</li></ul></li><li>仇小黑一技能机制更新后一技能提供的linked buff现在共享使用次数，被强化解除时被一起解除</li><li>修正强化解除耐性可能会在不该生效的情况下生效的问题</li></ul></li></ul><h2 id="v2-5-8修复" tabindex="-1">v2.5.8修复 <a class="header-anchor" href="#v2-5-8修复" aria-label="Permalink to &quot;v2.5.8修复&quot;">​</a></h2><ul><li>修复特殊敌方职阶使用了错误的职阶克制系数</li><li>修复吉尔伽美什一技能特性检测</li></ul><h2 id="v2-5-7修复" tabindex="-1">v2.5.7修复 <a class="header-anchor" href="#v2-5-7修复" aria-label="Permalink to &quot;v2.5.7修复&quot;">​</a></h2><ul><li>修复马琴技能 3</li></ul><h2 id="v2-5-6修复" tabindex="-1">v2.5.6修复 <a class="header-anchor" href="#v2-5-6修复" aria-label="Permalink to &quot;v2.5.6修复&quot;">​</a></h2><ul><li>【高难相关】支持 breakGaugeUp （加血条）</li><li>【高难相关】支持毅力回复量提升</li><li>【高难相关】现在最大HP提升类 buff 在施加后不会为已死之人回复血量（主要影响破血条）</li><li>【高难相关】敌方妖兰现在可以正确使用三技能</li><li>【高难相关】敌方技能现在不限制使用次数</li><li>支持小安宝具</li><li>毅力时会清除累计伤害（overkill bug相关）</li><li>从者被施加百分比类最大HP提升类 buff 总是会回复至满血的bug</li></ul><h2 id="v2-5-5修复" tabindex="-1">v2.5.5修复 <a class="header-anchor" href="#v2-5-5修复" aria-label="Permalink to &quot;v2.5.5修复&quot;">​</a></h2><ul><li>【高难相关】支持 shiftGuts</li><li>修复 preventDeathByDamage （梵高不会因诅咒致死的被动）相关结算</li></ul><h2 id="v2-5-2修复" tabindex="-1">v2.5.2修复 <a class="header-anchor" href="#v2-5-2修复" aria-label="Permalink to &quot;v2.5.2修复&quot;">​</a></h2><ul><li>【高难相关】最大HP提升类 buff 在破血条时不生效</li><li>修复指令卡类型变更后纹章和指令卡强化未生效</li></ul><h2 id="v2-5-0修复" tabindex="-1">v2.5.0修复 <a class="header-anchor" href="#v2-5-0修复" aria-label="Permalink to &quot;v2.5.0修复&quot;">​</a></h2><ul><li>支持托勒密</li></ul><h2 id="v2-4-18修复" tabindex="-1">v2.4.18修复 <a class="header-anchor" href="#v2-4-18修复" aria-label="Permalink to &quot;v2.4.18修复&quot;">​</a></h2><ul><li>现在伤害和暴击星获取计算也使用32位进行（原来是64位） <ul><li>降低精度是因为 fgo 本体使用的是32位</li><li>原有64位的情况下，伤害误差为±1</li><li>NP获取计算一直是32位，无误差</li></ul></li></ul><h2 id="v2-4-16修复" tabindex="-1">v2.4.16修复 <a class="header-anchor" href="#v2-4-16修复" aria-label="Permalink to &quot;v2.4.16修复&quot;">​</a></h2><ul><li>修复泳装小黑宝具特攻无法触发的问题</li><li>修复泳装妖崔延长持续回合的技能对无法解除的 buff 生效的问题</li></ul><h2 id="v2-4-15修复" tabindex="-1">v2.4.15修复 <a class="header-anchor" href="#v2-4-15修复" aria-label="Permalink to &quot;v2.4.15修复&quot;">​</a></h2><ul><li>修复额外被动技能可能会使模拟错误的情况</li><li>修复部分高难 buff 目标选取失败使模拟错误的情况</li></ul><h2 id="v2-4-14修复" tabindex="-1">v2.4.14修复 <a class="header-anchor" href="#v2-4-14修复" aria-label="Permalink to &quot;v2.4.14修复&quot;">​</a></h2><ul><li>修复泳装克洛伊无法撤退</li></ul><h2 id="v2-4-13修复" tabindex="-1">v2.4.13修复 <a class="header-anchor" href="#v2-4-13修复" aria-label="Permalink to &quot;v2.4.13修复&quot;">​</a></h2><ul><li>修复指令纹章攻击时付与的buff被视为passive buff (引入泳装克洛伊无法撤退的bug)</li></ul><h2 id="v2-4-12修复" tabindex="-1">v2.4.12修复 <a class="header-anchor" href="#v2-4-12修复" aria-label="Permalink to &quot;v2.4.12修复&quot;">​</a></h2><blockquote><p>动了一些结构，会出现很多以前正常工作现在出错的bug</p></blockquote><ul><li>修复Kingprotea三技能宝威失效</li><li>修复指令卡封印未生效</li><li>修复日服夏活点数buff宝威未生效</li><li>修复场地等部分buff检查</li></ul><h2 id="v2-4-11修复" tabindex="-1">v2.4.11修复 <a class="header-anchor" href="#v2-4-11修复" aria-label="Permalink to &quot;v2.4.11修复&quot;">​</a></h2><ul><li>支持泳装巴格斯特的宝具变更效果</li><li>修复登场效果应只发动一次(泳装克洛伊羁绊礼装)</li><li>修复上传队伍合理性检查失败</li></ul><h2 id="v2-4-10修复" tabindex="-1">v2.4.10修复 <a class="header-anchor" href="#v2-4-10修复" aria-label="Permalink to &quot;v2.4.10修复&quot;">​</a></h2><ul><li>修复安徒生强化后的技能3&amp;诺克娜蕾技能3条件检测</li><li>修复夏活活动点数buff</li><li>修复撤退为替补时需检查是否可行动(泳装克洛伊技能2)</li><li>【错误！原先正确现在修成bug】修复登场技能发动次数可发动多次(泳装克洛伊羁绊礼装)</li><li>修复从者活动特性需检查再临阶段(夏活村正加成仅初始再临阶段)</li></ul><h2 id="v2-4-9修复" tabindex="-1">v2.4.9修复 <a class="header-anchor" href="#v2-4-9修复" aria-label="Permalink to &quot;v2.4.9修复&quot;">​</a></h2><ul><li>正在重写伤害相关的触发逻辑 <ul><li>黑呆一技能强化和宝具的互动</li><li>马琴三技能和宝具的互动</li><li>暗狐三技能和宝具的互动</li><li>北斋三技能和宝具的互动</li><li>怖军三技能和宝具的互动</li></ul></li><li>陈宫、大英雄等多段伤害和睡眠的互动</li><li>counterFunction - 巴泽特宝具测试</li></ul><h2 id="v2-4-8修复" tabindex="-1">v2.4.8修复 <a class="header-anchor" href="#v2-4-8修复" aria-label="Permalink to &quot;v2.4.8修复&quot;">​</a></h2><ul><li>换人时可能导致程序执行错误</li><li>添加对水妃摩根技能新机制的支持 <ul><li>重写了解除成功时、即死成功时发动的效果逻辑，同时修复咒腕宝具效果的判定</li></ul></li></ul><h2 id="v2-4-7修复" tabindex="-1">v2.4.7修复 <a class="header-anchor" href="#v2-4-7修复" aria-label="Permalink to &quot;v2.4.7修复&quot;">​</a></h2><ul><li>重构底层代码关于目标选取的判断，修正部分御主礼装发动者误判的bug</li></ul><h2 id="v2-4-6修复" tabindex="-1">v2.4.6修复 <a class="header-anchor" href="#v2-4-6修复" aria-label="Permalink to &quot;v2.4.6修复&quot;">​</a></h2><ul><li>被伤害增加、减免实际效果相反</li><li>以敌方为发动者使用自定义技能后再使用御主礼装技能可能导致发动者错误</li><li>添加对 INDIVIDUALITIE_AND 和 INDIVIDUALITIE_OR 脚本的支持</li></ul><h2 id="v2-4-5修复" tabindex="-1">v2.4.5修复 <a class="header-anchor" href="#v2-4-5修复" aria-label="Permalink to &quot;v2.4.5修复&quot;">​</a></h2><ul><li>北斋 (Foreigner) 三技能宝具攻击后敌方全体降防误在宝具攻击前生效</li><li>获取数据时用户仍可操作，在某些情况下会导致错误</li><li>部分需求从者为特定稀有度的技能发动未检查从者稀有度</li><li>functionWaveStart - 场次开始时效果，通常用于敌方、场地效果</li></ul><h2 id="v2-4-4修复" tabindex="-1">v2.4.4修复 <a class="header-anchor" href="#v2-4-4修复" aria-label="Permalink to &quot;v2.4.4修复&quot;">​</a></h2><ul><li>从者HP芙芙调整上限为20000</li></ul><h2 id="v2-4-2修复" tabindex="-1">v2.4.2修复 <a class="header-anchor" href="#v2-4-2修复" aria-label="Permalink to &quot;v2.4.2修复&quot;">​</a></h2><ul><li>当添加或去除特性的 buff 需要检测从者特性时会导致 StackOverflow</li></ul><h2 id="v2-4-1修复" tabindex="-1">v2.4.1修复 <a class="header-anchor" href="#v2-4-1修复" aria-label="Permalink to &quot;v2.4.1修复&quot;">​</a></h2><ul><li>我方从者在敌方单位立刻补充的关卡上也立刻补充</li></ul><h2 id="v2-4-0修复" tabindex="-1">v2.4.0修复 <a class="header-anchor" href="#v2-4-0修复" aria-label="Permalink to &quot;v2.4.0修复&quot;">​</a></h2><ul><li>宫本武藏（Saber）的强化后宝具的特攻总是生效</li><li>概念礼装技能先于所有从者被动触发。这会导致当卡莲（Ruler）装备付与自身弱化无效的礼装时，友方的复仇者被动可能会因为队伍顺序无法正确付与卡莲弱化耐性下降</li></ul><h2 id="v2-3-6修复" tabindex="-1">v2.3.6修复 <a class="header-anchor" href="#v2-3-6修复" aria-label="Permalink to &quot;v2.3.6修复&quot;">​</a></h2><ul><li>为修复回合结束时效果可能提前一回合消失的问题重构 buff 回合数计数方式</li><li>gainNpIndividualSum 现在正确地从指定的目标进行特性计数</li></ul><h2 id="v2-3-5修复" tabindex="-1">v2.3.5修复 <a class="header-anchor" href="#v2-3-5修复" aria-label="Permalink to &quot;v2.3.5修复&quot;">​</a></h2><ul><li>〔毒〕回复化 - 洛库斯塔二技能</li><li>攻击后效果未在宝具攻击后触发 - 超级班杨宝具</li><li>兽尼禄宝具特攻不生效 <ul><li>添加了一个当兽尼禄在队伍中时自动为敌方从者添加兽尼禄特攻特性的选项</li></ul></li></ul><h2 id="v2-3-3修复" tabindex="-1">v2.3.3修复 <a class="header-anchor" href="#v2-3-3修复" aria-label="Permalink to &quot;v2.3.3修复&quot;">​</a></h2><ul><li>部分检查目标或自身的 buff 的特性的 buff 不会生效。例：纹章 77（天帝的贵妃）检测目标具有灼烧 buff。</li><li>当一个从者有复数的宝具类型变更 buff 时，首个 buff 会错误地覆盖之后的 buff。</li><li>当一个从者有复数的改变职阶相性的 buff 且数值更改皆为强制性（overwriteForce）时，之后的 buff 会错误地覆盖首个 buff。例：迦摩三技能&amp;莱妮斯宝具 vs AE 阶敌人。</li><li>七周年之后选项开启后，无效的首卡(如封印/眩晕)实际能提供染色，但目前模拟器为未染色。</li></ul>',70),t=[r];function h(o,v,n,d,b,f){return a(),i("div",null,t)}const q=l(u,[["render",h]]);export{c as __pageData,q as default};
